import React from 'react';

const Dashboard = () => {
  return (
    <div className='bg-utama'>
        <div className="container mt-5">
        <h2>Dashboard</h2>
        <p>Selamat datang di Dashboard Padiscan. Anda dapat mulai dengan melakukan identifikasi atau melihat riwayat diagnosis.</p>
        <div className="d-flex justify-content-between mt-4">
            <div className="card p-3" style={{ width: '45%' }}>
            <h5>Identifikasi Baru</h5>
            <p>Klik untuk melakukan identifikasi baru</p>
            <a href="/identifikasi" className="btn btn-primary">Mulai Identifikasi</a>
            </div>
            <div className="card p-3" style={{ width: '45%' }}>
            <h5>Riwayat Diagnosis</h5>
            <p>Lihat hasil diagnosis sebelumnya</p>
            <a href="/riwayat" className="btn btn-secondary">Lihat Riwayat</a>
            </div>
        </div>
        </div>
    </div>
  );
};

export default Dashboard;
